import React, { useState } from 'react';

function App() {

  const list = [
    {
      title: 'React',
      url: 'https://reactjs.org/',
      author: 'Jordan Walker',
      points: 4,
      objectID: 0,
    },
    {
      title: 'Redux',
      url: 'https://redux.js.org/',
      author: 'Jordan Walker',
      points: 5,
      objectID: 1,
    }
  ]



  return (
    <>
    {
      list && list.length>0 && 
        list.map((item) => {
          return (
            <ul>
              <li key={item.objectID}>
                <span>
                  {item.title}
                </span>
              </li>
            </ul>
          )
        })

    }
    </>
  );
}

export default App;
